import React from 'react';

// components
import PageTitle from '../../components/PageTitle';

const Starter = () => {
    return (
        <>
            <PageTitle
                breadCrumbItems={[
                    { label: 'Extra Pages', path: '/pages/starter' },
                    { label: 'Starter', path: '/pages/starter', active: true },
                ]}
                title={'Starter'}
            />
        </>
    );
};

export default Starter;
